The byte-level interface to the UART, which can send and receive
simultaneously.

<p> This interface, as it directly abstracts hardware, follows the
hardware interface convention of not maintaining state. Therefore,
some conditions that could be understood by a higher layer to be
errors execute properly; for example, one can call
<code>txBit</code> when in receive mode. A higher level interface
must provide the checks for conditions such as this.

@author Jason Hill
@author David Gay
@author Philip Levis
@author Robbie Adler

The previous call to <code>put</code> has completed; another byte
may now be sent.

@return SUCCESS always.

 A packet has been received. The packet received is passed as a
 pointer parameter. The event handler should return a pointer to a
 packet buffer for the reception layer to use for the next
 reception. This allows an application to swap buffers back and
 forth with the messaging layer, preventing the need for
 copying. The signaled component should not maintain a reference
 to the buffer that it returns. It may return the buffer it was
 passed. For example:
 <code><pre>
 event TOS_MsgPtr ReceiveMsg.receive(TOS_MsgPtr m) {
    return m;
 }
 </pre></code>

 A more common example:
 <code><pre>
 TOS_MsgPtr buffer;
 event TOS_MsgPtr ReceiveMsg.receive(TOS_MsgPtr m) {
    TOS_MsgPtr tmp;
    tmp = buffer;
    buffer = m;
	post receiveTask();
	return tmp;
 }
 </pre></code>

 @return A buffer for the provider to use for the next packet.

Interface to a route selection component in the TinyOS ad-hoc
system architecture.
@author Philip Levis

Given a TinyOS message buffer, provide a pointer to the data
buffer within it that an application can use as well as its
length. Unlike the getBuffer of the Send interface, this can
be called freely and does not modify the buffer.

@param msg The message to get the data region of.

@param length Pointer to a field to store the length of the data region.

@return A pointer to the data region.

