Signals that a message has been received, which is supposed to be forwarded to another destination. Allows protocol layers above the routing layer to perform data aggregation or make application-specific decisions on whether to forward.
@param msg The complete buffer received.
@param payload The payload portion of the packet for this protocol layer. If this layer has layers above it, it should signal receive() with payload incremented by the size of its header. Payload is a pointer into the msg structure.
@param payloadLen The length of the payload buffer. If this layer has layers above it, it should signal receive() with payloadLen decreased by the size of its headers and footers.
@return SUCCESS indicates the packet should be forwarded, FAIL indicates that it should not be forwarded.

